import { Link } from 'react-router-dom';

export const Navigation = () => {
  
};

export const DesktopSidebar = () => {
  // Desktop Sidebar styled with Bootstrap
  return (
    <div className="d-none d-md-flex flex-column flex-shrink-0 p-3 bg-white h-100 shadow fixed-top" style={{ width: '280px', zIndex: 1000 }}>
      
      {/* Brand Header */}
      <Link to="/" className="d-flex align-items-center mb-4 mb-md-0 me-md-auto text-decoration-none p-2">
        <span className="sidebar-brand-icon me-3 shadow-sm">
           üç≤
        </span>
        <span className="fs-4 fw-bold" style={{ color: '#ea580c' }}>B·∫øp Vi·ªát 4.0</span>
      </Link>
      
      <hr className="text-secondary opacity-25 my-4" />

      {/* Navigation Links */}
      <ul className="nav nav-pills flex-column mb-auto gap-2">
        <li className="nav-item">
            <span className="text-uppercase text-secondary fw-bold px-3 py-2 d-block" style={{ fontSize: '0.75rem', letterSpacing: '1px' }}>Menu Ch√≠nh</span>
        </li>
        {NAV_ITEMS.map((item) => (
          <li className="nav-item" key={item.id}>
            <NavLink
              to={item.id}
              className={({ isActive }) => 
                `nav-link d-flex align-items-center gap-3 py-3 px-3 rounded-4 ${isActive ? 'active shadow text-white' : 'link-dark'}`
              }
            >
              {item.icon}
              {item.label}
            </NavLink>
          </li>
        ))}
         <li className="nav-item mt-4">
            <span className="text-uppercase text-secondary fw-bold px-3 py-2 d-block" style={{ fontSize: '0.75rem', letterSpacing: '1px' }}>C√° Nh√¢n</span>
        </li>
         <li className="nav-item">
            <NavLink
              to="/profile"
              className={({ isActive }) => 
                `nav-link d-flex align-items-center gap-3 py-3 px-3 rounded-4 ${isActive ? 'active shadow text-white' : 'link-dark'}`
              }
            >
              <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" d="M15.75 6a3.75 3.75 0 11-7.5 0 3.75 3.75 0 017.5 0zM4.501 20.118a7.5 7.5 0 0114.998 0A17.933 17.933 0 0112 21.75c-2.676 0-5.216-.584-7.499-1.632z" />
              </svg>
              H·ªì s∆°
            </NavLink>
          </li>
      </ul>

      {/* User Profile Card */}
      <div className="mt-auto">
        <hr className="text-secondary opacity-25" />
        <div className="card border-0 bg-light rounded-4 p-2 cursor-pointer hover-shadow transition" style={{cursor: 'pointer'}}>
           <div className="d-flex align-items-center">
             <img src="https://picsum.photos/100/100" alt="mdo" width="40" height="40" className="rounded-circle border border-2 border-white shadow-sm me-3" />
             <div className="flex-grow-1">
                <h6 className="mb-0 fw-bold text-dark">Ng∆∞·ªùi d√πng</h6>
                <small className="text-muted">ƒê·∫ßu b·∫øp t·∫°i gia</small>
             </div>
             <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-chevron-right text-muted" viewBox="0 0 16 16">
                <path fillRule="evenodd" d="M4.646 1.646a.5.5 0 0 1 .708 0l6 6a.5.5 0 0 1 0 .708l-6 6a.5.5 0 0 1-.708-.708L10.293 8 4.646 2.354a.5.5 0 0 1 0-.708z"/>
              </svg>
           </div>
        </div>
      </div>
    </div>
  );
};
